CREATE TABLE tweet (
  id varchar,
  text varchar,
  lang varchar,
  created_at timestamp, -- #13682: shall be timestamptz from TiDB timestamp, but canal is problematic
  author_id varchar,
  PRIMARY KEY (id)
) WITH (
    connector='kafka',
    topic='ticdc_test_tweet',
    properties.bootstrap.server='kafka:9092',
    scan.startup.mode='earliest'
) FORMAT CANAL ENCODE JSON;

create table user (
    id varchar,
    name varchar,
    username varchar,
    followers bigint,
    created_at timestamp,
    PRIMARY KEY (id)
) WITH (
    connector='kafka',
    topic='ticdc_test_user',
    properties.bootstrap.server='kafka:9092',
    scan.startup.mode='earliest'
) FORMAT CANAL ENCODE JSON;

create table datatype (
    id int,
    c0_boolean boolean,
    c1_tinyint smallint,
    c2_smallint smallint,
    c3_mediumint int,
    c4_int int,
    c5_bigint bigint,
    c6_float real,
    c7_double double,
    c8_decimal decimal,
    c9_date date,
    c10_datetime timestamp,
    c11_time time,
    c12_timestamp timestamp,
    c13_char varchar,
    c14_varchar varchar,
    c15_binary bytea,
    c16_varbinary bytea,
    c17_blob bytea,
    c18_text text,
    c19_json jsonb,
    PRIMARY KEY (id)
) WITH (
      connector='kafka',
      topic='ticdc_test_datatype',
      properties.bootstrap.server='kafka:9092',
      scan.startup.mode='earliest'
) FORMAT CANAL ENCODE JSON;

CREATE TABLE tidb_cdc_types (
    id integer PRIMARY KEY,
    c_boolean boolean,
    c_bit boolean,
    c_tinyint smallint,
    c_smallint smallint,
    c_mediumint integer,
    c_integer integer,
    c_bigint bigint,
    c_decimal decimal,
    c_float real,
    c_double double,
    c_char_255 varchar,
    c_varchar_10000 varchar,
    c_binary_255 bytea,
    c_varbinary_10000 bytea,
    c_date date,
    c_time time,
    c_datetime timestamp,
    c_timestamp timestamp,
    c_json jsonb
) WITH (
      connector='kafka',
      topic='ticdc_test_tidb_cdc_types',
      properties.bootstrap.server='kafka:9092',
      scan.startup.mode='earliest'
) FORMAT CANAL ENCODE JSON;

create table tidb_sink_datatypes (
  id integer PRIMARY KEY,
  c_boolean boolean,
  c_tinyint smallint,
  c_smallint smallint,
  c_mediumint integer,
  c_integer integer,
  c_bigint bigint,
  c_decimal decimal,
  c_float real,
  c_double double,
  c_char_255 varchar,
  c_varchar_10000 varchar,
  c_text varchar,
  c_blob bytea,
  c_binary_255 bytea,
  c_varbinary_10000 bytea,
  c_date date,
  c_time time,
  c_datetime timestamp,
  c_timestamp timestamptz,
  c_json JSONB,
  c_smallint_array smallint[],
  c_integer_array integer[],
  c_bigint_array bigint[],
  c_real_array real[],
  c_double_precision_array double precision[],
  c_varchar_array varchar[],
);

